@register(outgoing=True, pattern="^.hava")
async def _(event):
    if event.fwd_from:
        return
    deq = deque(list("‚òÄÔ∏èüå§‚õÖÔ∏èüå•‚òÅÔ∏èüå¶üåßüå©üå®‚ùÑÔ∏è"))
    for _ in range(48):
        await asyncio.sleep(0.1)
        await event.edit("".join(deq))
        deq.rotate(1)
        
